import React from 'react'

const TodoItem = (props) => {
    
    let onChange = props.OnChange;
    let id = props.id;
    
    

    return (
        <div>
            <li>
                <input type="checkbox" onChange={() =>  onChange(id) } />
                <strong>{props.id}</strong>
                <p>{props.name}</p>
                <button>&times;</button>
            </li>
        </div>
    )
}
export default TodoItem;
